import { useLocation } from "react-router-dom";
import BotaoPrecisao from "../compontente/BotaoPrecisao/BotaoPrecisao";
import Cabecalho from "../compontente/Cabecalho/Cabecalho";
import Estante from "../compontente/Estante/Estante";
import "./TelaEstante.css";
import { useEffect, useState } from "react";
import axios from "axios";
import Livro from "../compontente/Livro/Livro";

function TelaEstante() {
  
  const location = useLocation();
  
 
  
  const [Estantes, setEstantes] = useState([{}]);
   
  useEffect(() => {
    axios
      .get("http://localhost:8080/map")
      .then((resposta) => {
       setEstantes(resposta.data)
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  console.log(Estantes)
  return (
    <>

      <Cabecalho />
      <div className="TelaEstante">
      {Estantes.map((conteudo) => {
          if(conteudo != undefined){
            // eslint-disable-next-line no-undef
            if(conteudo.books == []){
            for(var book in conteudo.books){
                if(book.id == location.state.id){
                return (
                  <Estante x={conteudo.x} y={conteudo.y} r={conteudo.rotate} h={conteudo.height} w={conteudo.width} c="#FFF"/>
                            );
                }else {
                  return (
                    <Estante x={conteudo.x} y={conteudo.y} r={conteudo.rotate} h={conteudo.height} w={conteudo.width} c="FFF"/>
                              );
                }
            }
            }else{
              return ( 
              <Estante x={conteudo.x} y={conteudo.y} r={conteudo.rotate} h={conteudo.height} w={conteudo.width} c="red"/>
              )}
          }
        })}
        <BotaoPrecisao />
      </div>
    </>
  );
}

export default TelaEstante;
